    dwemer_collective_noun:1 "Amz-Vtharden"
    dwemer_desc:0 "The Amz-Vtharden, "Many of Shields", emerged as a distinct Dwemeri culture after the formation of the First Council in the earily #LORE [compendium_first_era]#!. The alliance forged through bonds of friendship between Dumac Dwarfking and Indoril Nerevar, Hortator of the Chimer, caused outrage among clans of the Dwemer. These events lead to a great exodus from Dwemereth, scattering the Deep Folk across large segments of northern Tamriel.\n\nThose who stayed built their "City of the Strong Shield" into a mighty kingdom to last the ages - until suddenly they were no more."
