    nord_culture_desc:0 "The Atmorans are a mysterious and ancient people, hailing from the legendary frozen continent of Atmora, though perhaps native to Tamriel as their own myths claim. Migration and invasion waves across the Sea of Ghosts led the Atmorans to first settle some liminal islands, and later the northern shores of Tamriel, where over time they renounced their homeland and became the ancestors of the Nords. The fate of Atmora remains shrouded in riddles and superstitions, but some believe that there are still Atmorans of the old blood and custom there, isolated from the tidings of the world beyond the sea."
